  false,\n\t\"url\": null,\n\t\"notes\": \"NOAA's Undersea Research Center for the
  Southeastern U.S. and Gulf of Mexico region (SEGM) explores and studies the waters
  off the Southeast coast as well as those in the Gulf of Mexico. These waters include
  the South Atlantic Bight, Florida Keys, and Gulf of Mexico, including the states
  of North Carolina, South Carolina Georgia, Florida, Alabama, Mississippi, and Texas.
  The Center's systems and technology include the Aquarius Undersea Lab, human-occupied
  submersibles, remotely operated vehicles, autonomous underwater vehicles, as well
  as other resource systems and tools.\",\n\t\"license_title\": null,\n\t\"extras\":
